message:
СБУ получили разговоры боевиков так называемых ЛНР и ДНР, которые в феврале 2022 года начали эскалацию событий на Донбассе.

На обнародованных записях слышно, как террористы и жители временно оккупированных территорий:

🔹 между собой признаются, что сами устраивают провокации и обстреливают мирное население;
🔹 обсуждают накопление русских войск, в том числе привлечение чеченцев «полка Кадырова»;
🔹удивляются, что силы ВСУ не реагируют на провокационные обстрелы боевиков;
🔹 рассказывают, что сами же боевики попали «в будку в России» (позднее ФСБ назвала это «обстрелом пограничного пункта РФ в Ростовской области»);
🔹подтверждают, что их снаряды попали в Луганскую ТЭС (в результате чего город Счастье остался без электро-, водо- и теплоснабжения).

Указанные разговоры удалось получить в ходе контрразведывательной работы СБУ.

Украина 360°
